import React, { Component } from "react";
import Navi from "./Navi";
import SearchBox from "./SearchBox";

export default class NavContainer extends Component {
  render() {
    return (
      <div>
        <nav>
          <Navi />
          <SearchBox />
        </nav>
      </div>
    );
  }
}
